import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navbarc.css';

class Navbar extends React.Component {

    constructor(props){
        super(props);
    }

    render(){
        return(
            <div>
                <h6>
                    Slate
                </h6>
                <form>
                    <input type = "button" value = {<NavLink className = "inactive" activeClassName = "active" to = "/">Home</NavLink>}/>

                </form>
            </div>
        );
    }
}

export default Navbar;
